	add("morel", "{\"term\":\"morel\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"German\", \"English\", \"frankish\", \"old high german (ca. 750-1050)\", \"picard\"], \"text\":\"{{borrowing|fr|morille|lang\u003den}} (compare Picard \u0027merouille\u0027 \u0027meroule\u0027 (morel, mushroom) , from Frankish {{m|frk|*morhila||mushroom}}, diminutive of {{m|frk|*morha||root}}, from Proto-germanic {{m|gem-pro|*murhǭ}}, {{m|gem-pro|*murhijǭ||carrot}}, from Proto-indo-european {{m|ine-pro|*mork-||tuber, edible herb}}. Akin to Old high german (ca. 750-1050) \u0027morhilo\u0027 \u0027morhela\u0027 (mushroom) (German \u0027morchel\u0027 (mushroom) , diminutive of Old high german (ca. 750-1050) \u0027morha\u0027 \u0027moraha\u0027 (tree-root, plant root) (German \u0027möhre\u0027 (carrot) . More at mor. Etymology_2|more.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several edible mushrooms, especially the or\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of several fungi in the genus \u0027Morchella\u0027, the upper part of which is covered with a reticulated and pitted hymenium\", \"priority\":2}]}, \"synonyms\":{}}");

	add("morelian", "{\"term\":\"morelian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Morelia|n|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A native or inhabitant of Morelia, a city in Mexico.\u0026lt;!--attested as an ajdective\", \"priority\":1}]}, \"synonyms\":{}}");

	add("moreness", "{\"term\":\"moreness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|more|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being more\", \"priority\":1}]}, \"synonyms\":{}}");

	add("morgon", "{\"term\":\"morgon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027morgon\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of red wine from the Beaujolais region\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, Stuart Evans, \u0027Seasonal Tribal Feasts\u0027, p. 166\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And so we went through the cold beef (Scottish forequarter spit-roasted) and chocolate mousse with a good \u0027\u0027Morgon\u0027\u0027 and curacao\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, John Fisher, \u0027The Evaluation of Wine\u0027, p. 198\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Morgon\u0027\u0027 is full-bodied and high in alcohol content (sometimes surpassing 14%), and has a little more tannin than the typical Beaujolais\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Victoria Moore, \u0027The Guardian\u0027, 10 Jul 2010\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I like \u0027\u0027Morgon\u0027\u0027 – powerful, dark and fleshy, with black rather than red fruit, it reminds me of walking into a deep cavern – and I think Julienas (masculine, earthy and granitic) and Chiroubles (the highest, and delicate, like birdsong) are under-rated.Category:en:Wines\", \"priority\":7}]}, \"synonyms\":{}}");

	add("morgue", "{\"term\":\"morgue\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027morgue\u0027 The second sense developed from the first, via \u0026quot;a prison examination room\u0026quot;, probably with reference to the haughty attitude of the jailers.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A supercilious or haughty attitude; arrogance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1855\u0027\u0027, Sir Richard Burton, \u0027Personal Narrative of a Pilgrimage to Al-Madinah and Meccah\u0027, Dover 1964, p. 34\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They being newcomers, free from the western \u0027\u0027\u0027morgue\u0027\u0027\u0027 so soon caught by Oriental Europeans, were particularly civil to me, even wishing to mix me a strong draught; but I was not so fortunate with all on board\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A building or room where dead bodies are kept before their proper burial or cremation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The archive and background information division of a newspaper.:: Kwapil, Joseph F. (2 July 1921) \u0026quot;Librarian Talks of Newspaper Morgue\u0026quot;, \u0027Fourth Estate\u0027 [http://books.google.com/books?id\u003dvws-AQAAMAAJ\u0026amp;pg\u003dPA5 page 5\", \"priority\":5}]}, \"synonyms\":{}}");

