	add("morna", "{\"term\":\"morna\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{jbo-etym|zh\u003d\u0027\u0027mo\u0027\u0027|zh_t\u003d模|zh_tr\u003dmó|en\u003dpat\u0027\u0027rn\u0027\u0027|en_t\u003dpattern|hi\u003dna\u0027\u0027m\u0027\u0027u\u0027\u0027na\u0027\u0027|hi_t\u003dनमूना|hi_tr\u003dnamūnā|ru\u003duz\u0027\u0027or\u0027\u0027|ru_t\u003dузор|ru_tr\u003duzor|ar\u003dna\u0027\u0027m\u0027\u0027ud\u0027\u0027a\u0027\u0027}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A genre of Cape Verdean music\", \"priority\":1}]}, \"synonyms\":{}}");

	add("morningness", "{\"term\":\"morningness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|morning|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The characteristic of being most active and alert during the morning; being a morning person\", \"priority\":1}]}, \"synonyms\":{}}");

	add("morocco", "{\"term\":\"morocco\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From the country-name of \u0027morocco\u0027 from which this leather was originally imported. Compare \u0027maroquin\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A soft leather, made from goatskin, used especially in bookbinding\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, \u0027Monsieur\u0027, Faber \u0026amp; Faber 1992, p. 164\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Piers put the letter in an envelope and slipped it into a green \u0027\u0027morocco\u0027\u0027-covered volume on the window seat – his sister\u0027s diary\", \"priority\":3}]}, \"synonyms\":{}}");

	add("moroseness", "{\"term\":\"moroseness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|morose|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Gloominess; sullenness; deep sadness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He acquired a slouching gait and ignoble look; his naturally reserved disposition was exaggerated into an almost idiotic excess of unsociable \u0027\u0027moroseness\u0027\u0027; and he took a grim pleasure, apparently, in exciting the aversion rather than the esteem of his few acquaintance\", \"priority\":2}]}, \"synonyms\":{}}");

	add("morphogenesis", "{\"term\":\"morphogenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|morpho|genesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The differentiation of tissues and subsequent growth of structures in an organism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("morphograph", "{\"term\":\"morphograph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|morpho|graph|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A logical fragment of a word, such as prefix or suffix, used in teaching spelling\", \"priority\":1}]}, \"synonyms\":{}}");

	add("morphology", "{\"term\":\"morphology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|morpho|logy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A scientific study of form and structure, usually without regard to function. Especially\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The study of the internal structure of morphemes (words and their semantic building blocks\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There are many ways to show that word structure is different from phrase and sentence structure. We will mention two here. First, free constituent order in syntax is common cross-linguistically; many languages lack fixed order of the kind that one finds in English. In \u0027\u0027morphology\u0027\u0027, on the other hand, order is always fixed. There is no such thing as free morpheme order. Even languages with wildly free word order, such as the Pama-Nyungan (Australian) language Warlpiri (Simpson 1991), have a fixed order of morphemes within the word. Second, syntactic and morphological patterns can differ within the same language. For example, note the difference in English in the positioning of head and complement between syntax and \u0027\u0027morphology\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The study of the form and structure of animals and plants\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The study of the structure of rocks and landforms\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The form and structure of something\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A description of the form and structure of something\", \"priority\":7}]}, \"synonyms\":{}}");

	add("morphome", "{\"term\":\"morphome\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|morpho|ome|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The totality of morphological features of a species\", \"priority\":1}]}, \"synonyms\":{}}");

	add("morphometry", "{\"term\":\"morphometry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|morpho|metry|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the measurement of the form of organisms\", \"priority\":1}]}, \"synonyms\":{}}");

	add("morphomics", "{\"term\":\"morphomics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|morpho|omics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The identification of the totality of the morphological features of species\", \"priority\":1}]}, \"synonyms\":{}}");

