	add("morsel", "{\"term\":\"morsel\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027morsel\u0027 from Old french (842-ca. 1400) \u0027morsel\u0027 from \u0027morsellum\u0027 () diminutive. of Latin \u0027morsum\u0027 (a bit) neuter of \u0027\u0027 past participle of \u0027mordere\u0027 () Compare French \u0027morceau\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small fragment or share of something, commonly applied to food\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A very small amount\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Pamela Griffin, \u0027New York Brides\u0027, Barbour Publishing Inc. (2008), ISBN 9781597899840, page 70\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Didn\u0027t even a \u0027\u0027morsel\u0027\u0027 of decency remain in his brother\", \"priority\":4}]}, \"synonyms\":{}}");

