	add("mortgage", "{\"term\":\"mortgage\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Proto-Germanic\", \"anglo-norman\"], \"text\":\"{{PIE root|en|mer|id1\u003ddie|wedʰ}}From Anglo-norman {{m|fro|morgage}}, Middle french (ca. 1400-1600) {{m|frm|mortgage}}, from Old french (842-ca. 1400) \u0027mort gage\u0027 (death pledge) after a translation of judicial {{m|la|mortuum vadium}} or \u0027mortuum wadium\u0027, from {{m|la|mortuum}} + \u0027vadium\u0027 or \u0027wadium\u0027, of Proto-germanic (Frankish origin, from a root *\u0027waddi\u0027, \u0027wadja\u0027. Compare \u0027gage\u0027 and also \u0027wage\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A special form of secured loan where the purpose of the loan must be specified to the lender, to purchase assets that must be fixed (not movable) property such as a house or piece of farm land. The assets are registered as the legal property of the borrower but the lender can seize them and dispose of them if they are not satisfied with the manner in which the repayment of the loan is conducted by the borrower. Once the loan is fully repaid, the lender loses this right of seizure and the assets are then deemed to be unencumbered\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"State of being pledged\", \"priority\":2}]}, \"synonyms\":{}}");

	add("mortgagee", "{\"term\":\"mortgagee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who provides a loan secured upon the borrowers\u0027 property, the lender in a mortgage agreement\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mortification", "{\"term\":\"mortification\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027mortification\u0027 from Old french (842-ca. 1400) from Latin \u0027mortificatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of mortifying\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A sensation of extreme shame or embarrassment\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d8|passage\u003dThe humor of my proposition appealed more strongly to Miss Trevor than I had looked for, and from that time forward she became her old self again; for, even after she had conquered her love for the Celebrity, the \u0027\u0027mortification\u0027\u0027 of having been jilted by him remained\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The death of part of the body\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027, w:D. H. D.H. Lawrence, Sons and Lovers\u0027, s:Sons and Lovers/Chapter chapter\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"And then there\u0027s the fever and the \u0027\u0027mortification\u0027\u0027—if it took bad ways he\u0027d quickly be gone\", \"priority\":6}]}, \"synonyms\":{}}");

	add("mortmain", "{\"term\":\"mortmain\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027mortmayn\u0027 \u0027\u0027 from Old french (842-ca. 1400) \u0027mortes meins\u0027 after phrase \u0027\u0027 See Latin \u0027mors\u0027 (\u0026quot;dead\u0026quot;) + \u0027\u0027 (\u0026quot;hand\u0026quot;).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The perpetual, inalienable possession of lands by a corporation or non-personal entity such as a church\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1824\u0027\u0027, s:Charter of Incorporation of the Royal Asiatic Society of Great Britain and Charter of Incorporation of the Royal Asiatic Society of Great Britain and Ireland\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"W]e do hereby grant our especial license and authority unto all and every person to grant sell alien and convey in \u0027\u0027mortmain\u0027\u0027 unto and to the use of the said Society and their successors\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027, w:Frederic William Frederic William Maitland, \u0026quot;s:The Corporation The Corporation Sole\u0026quot;, \u0027Law Quarterly Review\u0027, v. 16\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Though in truth it was the law of \u0027\u0027mortmain\u0027\u0027 which originally sent the founders of chantries to seek the king\u0027s licence\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A strong and inalienable possession\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1770\u0027\u0027, w:Edmund Edmund Burke, \u0027Thoughts on the Present Discontents, and Speeches\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"and some part of that influence [of the government], which would otherwise have been possessed as in a sort of \u0027\u0027mortmain\u0027\u0027 and unalienable domain, returned again to the great ocean from whence it arose\", \"priority\":8}]}, \"synonyms\":{}}");

